import React, { useState } from 'react';
import axios from 'axios';
import './Form.scss'; // Reusing your existing CSS file
import Navbar from './../Navbar/Navbar';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

const SlotForm = () => {
    const [formData, setFormData] = useState({
        date: '',
        startTime: '',
        endTime: '',
        topic: '',
        status: 'active'
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        try {
            const token = localStorage.getItem('auth-token'); // Assuming token is stored in localStorage

            const response = await axios.post('/api/slot/saveslot', formData, {
                headers: {
                    'auth-token': token,
                }
            });

            if (response.data.success) {
                toast.success('Slot saved successfully!');
                setFormData({
                    date: '',
                    startTime: '',
                    endTime: '',
                    topic: '',
                    status: 'active'
                });
            }
        } catch (error) {
            toast.error('Error saving slot: ' + error.response?.data?.error || 'Unknown error');
        }
    };

    return (
        <>
            <Navbar isLogin="true" />
            <ToastContainer
                position="top-right"
                autoClose={5000}
                hideProgressBar={false}
                newestOnTop={false}
                closeOnClick
                rtl={false}
                pauseOnFocusLoss
                draggable
                pauseOnHover
                theme="light"
            />

            <div className="form-body">
                <div className="form-box">
                    <div className="form-header">
                        <h3>Create Slot</h3>
                    </div>
                    <div className="form-inner-body">
                        <form onSubmit={handleSubmit}>
                            <div className="input-group">
                                <input 
                                    type="date" 
                                    name="date" 
                                    value={formData.date} 
                                    onChange={handleChange} 
                                    required
                                />
                                <label htmlFor="date">Date</label>
                            </div>
                            <div className="input-group">
                                <input 
                                    type="time" 
                                    name="startTime" 
                                    value={formData.startTime} 
                                    onChange={handleChange} 
                                    required
                                />
                                <label htmlFor="startTime">Start Time</label>
                            </div>
                            <div className="input-group">
                                <input 
                                    type="time" 
                                    name="endTime" 
                                    value={formData.endTime} 
                                    onChange={handleChange} 
                                    required
                                />
                                <label htmlFor="endTime">End Time</label>
                            </div>
                            <div className="input-group">
                                <input 
                                    type="text" 
                                    name="topic" 
                                    value={formData.topic} 
                                    onChange={handleChange} 
                                    placeholder="Topic" 
                                    required
                                />
                                <label htmlFor="topic">Topic</label>
                            </div>
                            <div className="input-group">
                                <select 
                                    name="status" 
                                    value={formData.status} 
                                    onChange={handleChange}
                                >
                                    <option value="active">Active</option>
                                    <option value="booked">Booked</option>
                                    <option value="completed">Completed</option>
                                </select>
                                <label htmlFor="status">Status</label>
                            </div>
                            <div className="input-group">
                                <button type="submit" className="btn">
                                    Save Slot
                                </button>
                            </div>
                        </form>
                    </div>
                </div>
            </div>
        </>
    );
};

export default SlotForm;
